import { Home, LiveTv, OndemandVideoSharp, SportsEsports } from "@mui/icons-material";

export const logo = './logo-tube.png';

export const category = [
    {name: 'New', icon: <Home />},
    {name: 'Movie', icon: <OndemandVideoSharp />},
    {name: 'Live', icon: <LiveTv />},
    {name: 'Gaming', icon: <SportsEsports />}
]
